import React from 'react';

const Contact = () => (
  <section id="contact" className="h-screen snap-start flex flex-col justify-center items-center bg-white text-center px-4">
    <h2 className="text-4xl font-bold mb-4">Contact</h2>
    <p className="text-md text-gray-700">Email: <a href="mailto:vasudhamaddi114@gmail.com" className="text-blue-600">vasudhamaddi114@gmail.com</a></p>
    <p className="text-md text-gray-700">GitHub: <a href="https://github.com/VasudhaMaddi" className="text-blue-600">github.com/VasudhaMaddi</a></p>
    <p className="text-md text-gray-700">LinkedIn: <a href="https://linkedin.com/in/your-profile" className="text-blue-600">linkedin.com/in/your-profile</a></p>
  </section>
);

export default Contact;
